import React from 'react';

import './Post.css';

const post = (props) =>{
    console.log(props.id)
    return(
        <article className="Post"
        onClick = {
            () => props.clicked(props.id)
            }
        >
        <h1>{props.title}</h1>
        <div className="Info">
            <div className="Author">
                Author
            </div>
        </div>
    </article>
    )
} 


export default post;
